function unpackBlocks(source) {
    var blocks = [];
    var dataView = new DataView(source);
    var sourceLen = source.byteLength;
    var pos = 0;
    while (pos<sourceLen) {
        var blockLen = dataView.getUint32(pos);
        pos += 4;
        blocks.push(source.slice(pos,pos+blockLen));
        pos += blockLen;
    }
    return blocks;
}

